function maximumTripletValue(nums: number[]): number {
    let max = 0, max2 = -Infinity, max3 = -Infinity;
    let min = Infinity, min2 = Infinity;

    for (const num of nums) {
        if (num > max) {
            max3 = max2;
            max2 = max;
            max = num;
        } else if (num > max2) {
            max3 = max2;
            max2 = num;
        } else if (num > max3) {
            max3 = num;
        }

        if (num < min) {
            min2 = min;
            min = num;
        } else if (num < min2) {
            min2 = num;
        }
    }

    return Math.max((max - max2) * max3, (min - min2) * max);
}
